import React, { Component } from "react";
const getNum = (max) => {
  return Math.floor(Math.random() * max);
};
class NumPicker extends Component {
  render() {
    return (
      <div>
        <h1>Your num is...{getNum(10)}</h1>
      </div>
    );
  }
}
export default NumPicker;
